import SeeAll from "../seeAll/SeeAll";
import "./albumsComponents.scss";

const AlbumsCompoment = () => {
  return (
    <div className="c-albums h-component">
      <div className="top">
        <h3 className="c-title">Albums</h3>
        <SeeAll pageLink={"/albums"} />
      </div>
    </div>
  );
};

export default AlbumsCompoment;
